cc-badge cat-development-tools-badge To accommodate scenarios where additional C, C++, or assembly is required in a project, the cc crate offers a simple api for compiling bundled C/C++/asm code into static libraries ( .a ) that can be statically linked to by rustc . The following example has some bundled C code ( src/hello.c ) that will be used from rust. Before compiling rust source code, the "build" file ( build.rs ) specified in Cargo.toml runs. Using the cc crate, a static library file will be produced (in this case, libhello.a , see compile docs ) which can then be used from rust by declaring the external function signatures in an extern block. Since the bundled C is very simple, only a single source file needs to be passed to cc::Build . For more complex build requirements, cc::Build offers a full suite of builder methods for specifying include paths and extra compiler flag s. Cargo.toml [package]
name = "cc-bundled-static"
version = "0.1.0"
edition = "2021"
build = "build.rs" [build-dependencies]
cc = "1.1.28" build.rs fn main() { cc::Build::new() .file("src/hello.c") .compile("hello"); // outputs `libhello.a`
} src/hello.c #include <stdio.h> void hello() { printf("Hello from C!\n");
} void greet(const char* name) { printf("Hello, %s!\n", name);
} cc-bundled-static/src/main.rs use std::error::Error;
use std::ffi::CString;
use std::os::raw::c_char; fn prompt(s: &str) -> Result<String, Box<dyn Error>> { use std::io::Write; print!("{}", s); std::io::stdout().flush()?; let mut input = String::new(); std::io::stdin().read_line(&mut input)?; Ok(input.trim().to_string())
} extern { fn hello(); fn greet(name: *const c_char);
} fn main() -> Result<(), Box<dyn Error>> { unsafe { hello() } let name = prompt("What's your name? ")?; let c_name = CString::new(name)?; unsafe { greet(c_name.as_ptr()) } Ok(())
}

