reqwest-badge select-badge url-badge cat-net-badge Call get_base_url to retrieve the base URL. If the document has a base tag, get the href attr from base tag. Position::BeforePath of the original URL acts as a default. Iterates through links in the document and creates a tokio::spawn task that will parse an individual link with url::ParseOptions and Url::parse ). The task makes a request to the links with reqwest and verifies StatusCode . Then the tasks await completion before ending the program. use error_chain::error_chain;
