rusqlite-badge cat-database-badge Connection::open will open the cats.db database from the top recipe, and assumes the cat_colors table exists. Begin a transaction with Connection::transaction . Transactions will roll back unless committed explicitly with Transaction::commit . In the following example, colors are added to a table having a unique constraint on the color name. When an attempt to insert a duplicate color is made, the transaction rolls back. At the end of successful_tx() the cat_colors table should have exactly two rows, with the colors 'lavender' and 'blue'. At the end of rolled_back_tx(), the cat_colors table should still have just 'lavender' and 'blue', since the the DELETE and the INSERTs will not have been committed. use anyhow::{Error, Result};
use rusqlite::Connection; fn main() -> Result<()> { let mut conn = Connection::open("cats.db")?; successful_tx(&mut conn)?; println!("successful transaction is successful"); let res = rolled_back_tx(&mut conn); assert!(res.is_err()); println!("rolled back transaction is an error"); Ok(())
} fn successful_tx(conn: &mut Connection) -> Result<()> { let tx = conn.transaction()?; tx.execute("DELETE FROM cat_colors", [])?; tx.execute("INSERT INTO cat_colors (name) VALUES (?1)", &[&"lavender"])?; tx.execute("INSERT INTO cat_colors (name) VALUES (?1)", &[&"blue"])?; tx.commit().map_err(Error::new)
} fn rolled_back_tx(conn: &mut Connection) -> Result<()> { let tx = conn.transaction()?; tx.execute("DELETE FROM cat_colors", [])?; tx.execute("INSERT INTO cat_colors (name) VALUES (?1)", &[&"grey"])?; tx.execute("INSERT INTO cat_colors (name) VALUES (?1)", &[&"black"])?; // Since this table has a UNIQUE constaint on color names, this will fail. tx.execute("INSERT INTO cat_colors (name) VALUES (?1)", &[&"grey"])?; tx.commit()?; Ok(())
} Since this program uses anyhow for error handling, the rustqlite::Result returned by the tx.commit() must be converted to a anyhow::Result. This can be done in a couple different ways as shown by the two transaction functions, and they are both equivalent to this code: match tx.commit() { Ok(x) => Ok(x), Err(err) => Err(anyhow::Error::new(err)),
}

